import React, { useState } from "react";
import { auth, db, googleProvider } from "../firebaseInit"; // Ensure Firebase is configured properly
import { createUserWithEmailAndPassword, signInWithPopup, sendEmailVerification } from "firebase/auth";
import { setDoc, doc } from "firebase/firestore";
import { TextField, Button, Switch, FormControlLabel, Container } from "@mui/material";

const Signup = () => {
    const [isProvider, setIsProvider] = useState(false);
    const [formData, setFormData] = useState({
        name: "",
        email: "",
        password: "",
        phone: "",
        address: "",
        providerCompanyName: "",
        providerFirstName: "",
        providerLastName: "",
        providerPhoneNumber: "",
        providerServices: "",
        providerDescription: "",
    });

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSignup = async () => {
        try {
            const userCredential = await createUserWithEmailAndPassword(auth, formData.email, formData.password);
            const user = userCredential.user;

            await sendEmailVerification(user);
            const userData = isProvider
                ? {
                    providerCompanyName: formData.providerCompanyName,
                    providerFirstName: formData.providerFirstName,
                    providerLastName: formData.providerLastName,
                    providerEmail: formData.email,
                    providerPhoneNumber: formData.providerPhoneNumber,
                    providerServices: formData.providerServices,
                    providerDescription: formData.providerDescription,
                    role: 1,
                    uid: user.uid,
                }
                : {
                    name: formData.name,
                    email: formData.email,
                    phone: formData.phone,
                    address: formData.address,
                    cart: [],
                    role: 0,
                    uid: user.uid,
                };

            await setDoc(doc(db, isProvider ? "providers" : "users", user.uid), userData);
            alert("Signup successful! Please verify your email.");
        } catch (error) {
            alert(error.message);
        }
    };

    const handleGoogleSignIn = async () => {
        try {
            const result = await signInWithPopup(auth, googleProvider);
            const user = result.user;
            const userData = isProvider
                ? {
                    providerCompanyName: "",
                    providerFirstName: "",
                    providerLastName: "",
                    providerEmail: user.email,
                    providerPhoneNumber: "",
                    providerServices: "",
                    providerDescription: "",
                    role: 1,
                    uid: user.uid,
                }
                : {
                    name: user.displayName,
                    email: user.email,
                    phone: user.phoneNumber || "",
                    address: "",
                    cart: [],
                    role: 0,
                    uid: user.uid,
                };
            await setDoc(doc(db, isProvider ? "providers" : "users", user.uid), userData);
            alert("Google Sign-In successful!");
        } catch (error) {
            alert(error.message);
        }
    };

    return (
        <Container>
            <FormControlLabel
                control={<Switch checked={isProvider} onChange={() => setIsProvider(!isProvider)} />}
                label={isProvider ? "Sign up as Provider" : "Sign up as User"}
            />
            {!isProvider ? (
                <>
                    <TextField label="Full Name" name="name" onChange={handleChange} fullWidth />
                    <TextField label="Phone" name="phone" onChange={handleChange} fullWidth />
                    <TextField label="Address" name="address" onChange={handleChange} fullWidth />
                </>
            ) : (
                <>
                    <TextField label="Company Name" name="providerCompanyName" onChange={handleChange} fullWidth />
                    <TextField label="First Name" name="providerFirstName" onChange={handleChange} fullWidth />
                    <TextField label="Last Name" name="providerLastName" onChange={handleChange} fullWidth />
                    <TextField label="Phone" name="providerPhoneNumber" onChange={handleChange} fullWidth />
                    <TextField label="Services" name="providerServices" onChange={handleChange} fullWidth />
                    <TextField label="Description" name="providerDescription" onChange={handleChange} fullWidth />
                </>
            )}
            <TextField label="Email" name="email" onChange={handleChange} fullWidth />
            <TextField label="Password" name="password" type="password" onChange={handleChange} fullWidth />
            <Button onClick={handleSignup} variant="contained">Sign Up</Button>
            <Button onClick={handleGoogleSignIn} variant="outlined">Sign In with Google</Button>
        </Container>
    );
};

export default Signup;
